import { FLOOR5_LABEL_POS, ZONE_LABELS } from "@/types/floor";

type Props = {
  zones: ZoneState[];
  selectedId: ZoneId | null;
  onSelect: (id: ZoneId) => void;
};

const EMERGENCY = new Set<ZoneId>(["Emergency_exit", "Emergency_exit2"]);

function fillFor(z: ZoneState) {
  if (EMERGENCY.has(z.id)) return "rgba(255,140,0,0.18)";
  if (z.status === "on") return "rgba(0,255,255,0.14)";
  if (z.status === "warning") return "rgba(255,196,0,0.14)";
  if (z.status === "emergency") return "rgba(255,140,0,0.18)";
  return "rgba(160,160,160,0.08)";
}

function strokeFor(z: ZoneState) {
  if (EMERGENCY.has(z.id)) return "rgba(255,140,0,0.85)";
  if (z.status === "on") return "rgba(0,255,255,0.85)";
  if (z.status === "warning") return "rgba(255,196,0,0.9)";
  if (z.status === "emergency") return "rgba(255,140,0,0.9)";
  return "rgba(120,120,120,0.5)";
}

